(147, 146, 2, '2012-03-29 10:45:06', 194, 7, 'About', 'About Us', '<p>Samson Tours. We’re a tour agency and tour operator, all rolled up into one.</p>', 'Samson Tours - About Us', 'About Us', '', 1, 0, 1, 'about'),
(146, 146, 2, '2012-03-29 10:45:06', 194, 7, 'About', 'About Us', '<p>Samson Tours. We’re a tour agency and tour operator, all rolled up into one.</p>', 'Samson Tours - About Us', 'About Us', '', 0, 0, 1, 'about'),
(113, 112, 2, '2012-04-11 00:43:32', 127, 7, 'Home', 'OOP Project', '<p>[home_slider]</p>\r\n<h3>Welcome to our new website!</h3>\r\n<p>In less than<strong> 3 minutes</strong>, you can sign up online for any of our <a title="Day Tours" href="http://www.samsontours.com/day-tours">Day Tours </a>or <a title="Group Tours" href="http://www.samsontours.com/group-tours">Group Tours</a>. <strong>In seconds</strong>, you can add a Day Tour from within your account and be touring within 24-hours. <strong>Your new account area</strong> also gives you updates about your tour and even the ability to <strong>pay your balances by credit card</strong>. <a title="Travel Insurance" href="http://www.samsontours.com/insurance">Travel Insurance</a> is also now available through our site. And best of all, we’re filling our site with <strong>new, rich content</strong> - <a title="Stops: The Best Content" href="http://www.samsontours.com/stops">Stops</a> - an area we’re certain you’ll enjoy!</p>\r\n<p>[group_tours] [day_tours] [stops]</p>', 'OOP Project', 'Samson Tours is a boutique tour agency and tour operator that specializes in group tours, private tours, family tours, and day tours to Israel.', '', 1, 0, 1, 'home'),
(165, 164, 2, '2012-03-29 10:52:37', 0, 7, 'Contact Us', 'Contact Us', '<div>{contact_form}</div>', 'Samoson Tours - Contact Us', 'You can contact contact us at Samson Tours 24/7. Our office hours are 7am-3pm EST.', '', 1, 0, 1, 'contact'),
